乐、激情、八卦、生活”的娱乐风格在中国电视娱乐版图迅速卡位，其带动的明星效应和倡导的快乐理念至今生命力不减，十几年来已融为中国青少年文化的一部分，并为湖南卫视打造成中国第一电视娱乐品牌定下基调不仅是湖南卫视一直保持至今的品牌节目，也是中国电视界综艺娱乐节目的领头羊；同时也是中国最有影响力的娱乐节目之一甚至成为中国亿万观众娱乐生活的一部分。娱乐圈内的知名艺人几乎都曾经登上过《快乐大本营》的舞台，留下属于他们的精彩瞬间。《快乐大本营》新创意的主题性综艺节目，为普通观众或草根团体及组合打造了一个展现个性的“全民娱乐”平台和分享快乐的机会，同时也极力为电视机前的观众推介时尚、新奇的文艺表演形式，传递“快乐至上”的娱乐精神，突出了以观众为主体的“娱乐天下”的节目理念。";s:13:"vod_play_from";s:19:"zuidam3u8$$$172m3u8";s:15:"vod_play_server";s:7:"no$$$no";s:13:"vod_play_note";s:3:"$$$";s:12:"vod_play_url";s:5099:"20190105期$http://shenling.dijiang-zuida.com/20190106/nRXr6KKb/index.m3u8#20190112期$http://shenling.dijiang-zuida.com/20190112/NAlhlOBI/index.m3u8#20190119期$http://yushou.qitu-zuida.com/20190119/25203_588f65e5/index.m3u8#20190126期$http://yushou.qitu-zuida.com/20190126/26787_5b0e210b/index.m3u8#20190202期$http://shenling.dijiang-zuida.com/20190202/wRhdsfjv/index.m3u8#20190209期$http://shenling.dijiang-zuida.com/20190209/bVrvXBF4/index.m3u8#20190216期$http://iqiyi.qq-zuidazy.com/20190216/5239_d74437fb/index.m3u8#20190223期$http://iqiyi.qq-zuidazy.com/20190223/5830_ecdc521c/index.m3u8#20190302期$http://iqiyi.qq-zuidazy.com/20190302/6413_7524af24/index.m3u8#20190309期$http://iqiyi.qq-zuidazy.com/20190309/6943_c523437d/index.m3u8#20190316期$http://shenling.dijiang-zuida.com/20190316/IAHewJv0/index.m3u8#20190323期$http://bili.meijuzuida.com/20190323/9201_553cc638/index.m3u8#20190330期$http://bili.meijuzuida.com/20190330/9942_69e5587a/index.m3u8#20190406期$http://iqiyi.qq-zuidazy.com/20190406/8568_f98eef41/index.m3u8#20190413期$http://iqiyi.qq-zuidazy.com/20190413/8942_f7c67eef/index.m3u8#20190420期$http://bili.meijuzuida.com/20190420/12119_3510fd6c/index.m3u8#20190427期$http://iqiyi.qq-zuidazy.com/20190427/9657_eb8d454c/index.m3u8#20190503期$http://bili.meijuzuida.com/20190503/13430_c3f004f0/index.m3u8#20190511期$http://iqiyi.qq-zuidazy.com/20190511/10424_23d44825/index.m3u8#20190518期$http://bili.meijuzuida.com/20190518/14791_cee9325c/index.m3u8#20190525期$http://iqiyi.qq-zuidazy.com/20190525/11190_985e0798/index.m3u8#